	[4] = {id=4, title="普通层事件", desc="神界冒险中有多种事件，完成不同事件可获得不同奖励：\n守卫：击败神界中强大的怪物即可探索周围区域。\n采集：不要白不要，点一下就可以获得奖励。\n答题：答对有奖，答错也没有惩罚哟。\nNPC事件：神界中有各种奇奇怪怪的npc，与他们交流说不定会有意外收获呢。\n冒险buff：拾取后仅可获得增益buff，本轮内对所有英雄生效。\n神之祝福：获得神的眷顾的人才能获得的物品。\n猜拳：下注猜拳，买定离手，你觉得你的手气如何呢~"},
	[5] = {id=5, title="冒险商店", desc="1.冒险中会遇到神秘商人，与神秘商人对话后，商品将会出现在冒险商店中。\n2.使用召唤商人后，商品也会出现在冒险商店中。\n3.冒险商店的商品在本次冒险重置后消失。"}
}
